import * as S from './styles'

import Header from '../../components/Header';

import api from '../../services/api'

export default class Home extends Component {
    constructor(props) {
        super(props)
        console.log('Meu inicializador')

        this.state = {rows: <p>This is my row</p>}
    }

    render() {
        return (
        <S.Container>
        <Header />
        {this.state.rows}
        </S.Container>
        )
    }
}
